<h2>Ajax</h2>
<p>基于XHR原生开发，目前已有的<code>fetch</code>可替代。本身针对mvc编程模式，不太适合目前mwm编程模式。JQ本身较大，如单纯使用ajax可自己封装1个，不然会影响性能体验</p>
<h2>Axios</h2>
